import { Chart, Tooltip, Axis, Legend, Pie, Coord, StackArea, Line, Bar, Point} from 'viser-react';


import * as React from 'react';
import { Row, Col, Card, Button, Icon, Progress } from "antd";
import axios from "axios";
import ReactApexChart from 'react-apexcharts'


const data = [
  {country: 'Asia', year: '1750', value: 502},
  {country: 'Asia', year: '1800', value: 635},

];

const scale = [{
  dataKey: 'year',
  type: 'linear',
  tickInterval: 50,
}];

class AnalyticalTest extends React.Component {
  render() {
    return (
      <Chart forceFit height={400}  width={1000} data={data} scale={scale}>
        <Tooltip />
        <Axis dataKey="value" />
        <Legend />
        <Line position="year*value" size={2} color="country" adjust="stack" />
        <StackArea position="year*value" color="country" />
      </Chart>
    );
  }
}



export default AnalyticalTest;
